mapper.select:

select 

from FCRMTOTAL
where FCRMTOTAL_DATE = #{fcrmtotalDate,jdbcType=CHAR}
  and FCRMTOTAL_BRNO = #{fcrmtotalBrno,jdbcType=CHAR}
  and FCRMTOTAL_CURRENCY = #{fcrmtotalCurrency,jdbcType=CHAR}

mapper.delete:

delete from FCRMTOTAL
where FCRMTOTAL_DATE = #{fcrmtotalDate,jdbcType=CHAR}
  and FCRMTOTAL_BRNO = #{fcrmtotalBrno,jdbcType=CHAR}
  and FCRMTOTAL_CURRENCY = #{fcrmtotalCurrency,jdbcType=CHAR}
